import React from "react";

const ContTitle = () => {
  return (
    <div className="cont_tit">
      <p className="eng_txt">className :</p>
      <p className="class_name">우당탕탕 웹디제이</p>
      <div className="teacher_info">
        <p className="eng_txt">Teacher : </p>
        <p>정영철</p>
      </div>
    </div>
  );
};

export default ContTitle;
